import React from 'react';
import styled from 'styled-components';

const SkillsSection = styled.section`
  padding: 4em;
  background: #fff;
  color: #333;
`;

const SkillBar = styled.div`
  margin: 1em 0;
  background: #ddd;
  height: 20px;
  width: 100%;
  border-radius: 10px;
  overflow: hidden;
  
  & div {
    height: 100%;
    width: ${({ width }) => width};
    background: #61dafb;
    transition: width 0.4s ease-in-out;
  }
`;

export const Skills = () => {
  return (
    <SkillsSection>
      <h2>Skills</h2>
      <SkillBar width="90%"><div></div>Python</SkillBar>
      <SkillBar width="80%"><div></div>Docker</SkillBar>
      <SkillBar width="85%"><div></div>Kubernetes</SkillBar>
    </SkillsSection>
  );
};
